import React from 'react';
import './styles.scss';
import LoginApi from 'api/LoginApi';
import LoginApiContext from 'api/context/LoginContext';


export default function Login() {

  return (
   <LoginApiContext.Provider>
     <LoginApi />
   </LoginApiContext.Provider>
  );

}
